import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';

export default function ContainedButtons() {
    return (
        <Stack direction="row" spacing={2}>
            <Button variant="contained">スタート</Button>
            <Button variant="contained" disabled>一時中断</Button>
            <Button variant="contained" disabled>タイムスタンプ</Button>
            <Button variant="contained" disabled>停止</Button>
            <Button variant="contained" disabled>保存</Button>
        </Stack>
    );
}
